import { useState } from "react";
import { useNavigate } from "react-router-dom"; 
import axios from "axios";

function SolicitudAutonomos() {
  const [formData, setFormData] = useState({
    nombre: "",
    dni: "",
    direccionNegocio: "",
    direccionParticular: "",
    telefono: "",
    email: "",
    estadoCivil: "",
    regimenMatrimonial: "",
    importe: "",
    plazo: "",
    actividad: "",
    cnae: "",
  });

  const [message, setMessage] = useState("");
  const navigate = useNavigate(); 

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Payload m√≠nimo con algunos defaults para que no falle
      const payload = {
        TITULAR: formData.nombre,
        NOMBRE: formData.nombre.split(" ")[0] || formData.nombre,
        APELLIDOS: formData.nombre.split(" ").slice(1).join(" ") || "",
        CIT: formData.dni,
        ACTIVIDAD: formData.actividad,
        COD_CNAE: formData.cnae,
        REGIMEN_ECONOMICO: formData.regimenMatrimonial,
        COD_DELEGACION: "001",
        TIPO_IDENTIDAD: "AUTONOMO",
        F_ALTA: new Date().toISOString().split("T")[0],
        F_CONSTITUCION: new Date().toISOString().split("T")[0],
        PAIS_NIF: "ES",
        COD_GESTOR: "WEB",
        VALIDEZ_DATOS: "S",
        PROCESO_ALTA: "WEB",
        EXPORTA: "N",
        NIVEL_COMPLETITUD: 0,
        CLASIF_PYME: "S",
        G3_BLOQUEO: "X",
        IDIOMA: "S",
      };

      console.log("üì§ Enviando payload:", payload);

      const res = await axios.post("http://127.0.0.1:5000/api/identidades", payload);

      if (res.status === 201) {
        setMessage("‚úÖ Solicitud creada con √©xito. REF_ID: " + res.data.REF_ID);

        setTimeout(() => {
          navigate("/alta"); 
        }, 1500);
      } else {
        setMessage("‚ö†Ô∏è Algo raro pas√≥. C√≥digo: " + res.status);
      }
    } catch (err) {
      console.error("‚ùå Error en solicitud:", err);
      setMessage(
        "‚ùå Error: " +
          (err.response?.status || "") +
          " - " +
          (err.response?.data?.error || err.message)
      );
    }
  };

  return (
    <div style={{ maxWidth: "800px", margin: "0 auto" }}>
      <h2>Solicitud de Aval Aut√≥nomos</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Nombre y Apellidos:
          <input
            type="text"
            name="nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          DNI/NIE:
          <input
            type="text"
            name="dni"
            value={formData.dni}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          Direcci√≥n (Negocio):
          <input
            type="text"
            name="direccionNegocio"
            value={formData.direccionNegocio}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Direcci√≥n (Particular):
          <input
            type="text"
            name="direccionParticular"
            value={formData.direccionParticular}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Tel√©fono:
          <input
            type="text"
            name="telefono"
            value={formData.telefono}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Email:
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Estado Civil:
          <input
            type="text"
            name="estadoCivil"
            value={formData.estadoCivil}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          R√©gimen Matrimonial:
          <input
            type="text"
            name="regimenMatrimonial"
            value={formData.regimenMatrimonial}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Importe (‚Ç¨):
          <input
            type="number"
            name="importe"
            value={formData.importe}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Plazo (meses):
          <input
            type="number"
            name="plazo"
            value={formData.plazo}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Actividad:
          <input
            type="text"
            name="actividad"
            value={formData.actividad}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          CNAE:
          <input
            type="text"
            name="cnae"
            value={formData.cnae}
            onChange={handleChange}
          />
        </label>
        <br />

        <button type="submit">Enviar Solicitud</button>
      </form>

      {message && <p>{message}</p>}
    </div>
  );
}

export default SolicitudAutonomos;
